import Container from '../components/Container';
import Head from 'next/head';

const Contacto = () => {
  return (
    <div>
      <Head>
        <script src="https://code.jquery.com/jquery-3.3.1.min.js"></script>
        <script src="../../utils/enviar.js"></script>
      </Head>
      <Container>
        <h2>Contacto...</h2>
      </Container>
    </div>
  );
};
export default Contacto;
